INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 0, 40011, 2, 1, 125801, "リリ", 321, 24001, 1);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (1, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 0, 40011, 2, 2, 126001, "クリア", 322, 24001, 1);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (1, "んーと。\nこれ、あげる。\nはい", 0, 40011, 2, 3, 126101, "プレシア", 323, 24001, 1);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (2, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 0, 40011, 2, 4, 125801, "リリ", 324, 24001, 1);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (2, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 0, 40011, 2, 5, 126001, "クリア", 325, 24001, 1);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (2, "お兄。\nきてくれて、うれしい", 0, 40011, 2, 6, 126101, "プレシア", 326, 24001, 1);
